import React from "react";
import Slider from "./Slider";

// style component
import "./style/reviews.css"

function reviews() {
  return (
    <>
      <div className="customerreviews">
        <div>reviews</div>
        <Slider />
      </div>
    </>
  );
}

export default reviews;
